const React=require("react");

function Meetup(props){
    return(
    <div className="meetup">
        <img className="pic3" src={props.picture}></img>
        <h4 className="heading3">{props.heading}</h4>
        <h2 className="title3">{props.title}</h2>
        <p className="date">{props.date}</p>
        <button className="btn btn-light" type="button"><span>Visit Website</span></button>
        <h3 className="name3">{props.name}</h3>

    </div>
    );
}

export default Meetup;
